CREATE TABLE `tr_comment` (
   `comment_id` int(11) not null auto_increment,
   `comment_text` text not null,
   `comment_user_id` int(11) not null,
   `comment_is_deleted` tinyint(1) default '0',
   PRIMARY KEY (`comment_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=39;


CREATE TABLE `tr_image` (
   `image_id` int(11) not null auto_increment,
   `image_post_id` int(11) not null,
   `image_path` varchar(255) not null,
   `image_palette` varchar(255) not null,
   PRIMARY KEY (`image_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1817;


CREATE TABLE `tr_like` (
   `like_post_id` int(11) not null,
   `like_user_id` int(11) not null,
   `like_id` int(11) not null auto_increment,
   PRIMARY KEY (`like_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1771;


CREATE TABLE `tr_post` (
   `post_id` int(11) not null auto_increment,
   `post_title` varchar(255),
   `post_text` varchar(255) not null,
   `post_user_id` int(11) not null,
   `post_timestamp` timestamp not null default CURRENT_TIMESTAMP,
   `post_is_deleted` tinyint(1) default '0',
   PRIMARY KEY (`post_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1822;


CREATE TABLE `tr_reply` (
   `reply_id` int(11) not null auto_increment,
   `reply_post_id` int(11) not null,
   `reply_comment_id` int(11),
   `reply_rebound_id` int(11),
   `reply_timestamp` timestamp not null default CURRENT_TIMESTAMP,
   `reply_is_deleted` tinyint(1) default '0',
   PRIMARY KEY (`reply_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=36;


CREATE TABLE `tr_session` (
   `session_id` varchar(40) not null default '0',
   `ip_address` varchar(16) not null default '0',
   `user_agent` varchar(120) not null,
   `last_activity` int(10) unsigned not null default '0',
   `user_data` text not null,
   PRIMARY KEY (`session_id`),
   KEY `last_activity_idx` (`last_activity`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


CREATE TABLE `tr_tag` (
   `tag_id` int(11) not null auto_increment,
   `tag_post_id` int(11),
   `tag_content` text not null,
   PRIMARY KEY (`tag_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1813;


CREATE TABLE `tr_user` (
   `user_id` int(11) not null auto_increment,
   `user_email` varchar(255) not null,
   `user_password` varchar(128) not null,
   `user_realname` varchar(255) not null,
   `user_bio` text,
   `user_avatar` varchar(256),
   `user_stubb` varchar(255),
   PRIMARY KEY (`user_id`),
   UNIQUE KEY (`user_email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1010;

